import React from "react";
import { useSelector } from "react-redux";

import { selectHome } from "../../redux/myhome/myhome.selectors";
import {
    selectDataObjectCorona,
    selectIsFetching,
} from "../../redux/data/data.selectors";

import { DetailOthersContainer } from "./detail-others.style";

const DetailOthers = () => {
    const home = useSelector(selectHome);
    const dataObjectCorona = useSelector(selectDataObjectCorona);
    const isFetching = useSelector(selectIsFetching);
    const country = isFetching ? {} : dataObjectCorona[home];
    const { deaths, confirmed, recovered } = country;
    return (
        <DetailOthersContainer>
            <DetailOthersWrap>
                <NameContainer></NameContainer>
                <ConfrimedContainer></ConfrimedContainer>
                <RecoveredContainer></RecoveredContainer>
                <DeathsContainer></DeathsContainer>
            </DetailOthersWrap>
        </DetailOthersContainer>
    );
};

export default DetailOthers;
